function ajaxLoad(ops)
{
  return $.ajax({
    type: 'POST',
    ops: ops,
    cache: false,
    timeout: 40000,
    url: window.baseUrl+ops.url,
    dataType: 'json',
    data: ops.data ? ops.data : null,
    beforeSend: function(jqXHR, settings){
      if (this.ops.onBeforeSend && 'function'==typeof this.ops.onBeforeSend){this.ops.onBeforeSend(this.ops);}
    },
    success: function(data){
      if (this.ops.onBeforeSuccess && 'function'==typeof this.ops.onBeforeSuccess){if (!this.ops.onBeforeSuccess(data, this.ops)){return};}

      if (isset(data.error))
      {
        alert(data.error)
      }

      if (data.html && this.ops.block)
      {
        $(this.ops.block).html(data.html);
      }

      if (isset(data.script))
      {
        try
        {
          eval(data.script);
        }
        catch (ex) { if (window.console && window.dbgMode){console.log(ex); console.log('[_ JS_] '+ex.stack); alert('   ');} }
      }

      if (this.ops.onSuccess && 'function'==typeof this.ops.onSuccess){this.ops.onSuccess(data, this.ops);}
      if (window.dbgMode) console.log(data);
    },
    error: function(jqXHR, textStatus, errorThrown){
      console.log(textStatus);
      switch (textStatus)
      {
        case 'timeout':
          alert('!    .       .');
          break;

        case 'error':
        case 'parsererror':
          alert(',    !'+"\n\n"+'   .'+"\n"+'    .');
          if (window.dbgMode) {
            console.log(jqXHR);
            console.log(errorThrown);
          }
          break;
      }
    }
  });
}

