function showImportantMessages(messages){
  if ($('#important-messages').length==0){
  $('body').append('<div id="important-messages"><table><tr><td>' +
    '<div id="imp-mes-wrap"><div id="imp-mes-list"></div><div class="mt2"><div id="imp-mes-btn" onclick="closeImportantMessages();">OK</div></div></div>' +
    '</td></tr></table></div>');
  } else {
    $('#important-messages .imp-mes').remove();
    $('#important-messages').show();
  }

  var list=$('#imp-mes-list');
  for (var k in messages){
    list.append('<div class="imp-mes" id="mes-'+messages[k]['id_message']+'">' +
      '<div class="date">'+messages[k]['d_date']+'</div>' +
      '<div class="mes">'+messages[k]['mes']+'</div>' +
      '</div>');
  }

  if (!$('html').hasClass('wind_opened')){
    var w=$('body').width(), mar=null;
    $('html').addClass('wind_opened');
    mar=$('body').width()-w;
    $('body').css('margin-right', mar);
  }
  k=list=null;
}
function closeImportantMessages(){
  $('#important-messages').hide();
  $('html').removeClass('wind_opened');
  $('body').css('margin-right',0);
  var removed=[];
  $('#important-messages .imp-mes').each(function(){
    removed.push(parseInt($(this).attr('id').replace(/^mes-/,'')));
  });
  ajaxLoad({url: 'profile/ajax/frm:remove_messages', data:{ids:removed}});
  removed=null;
}

function getURLParam(name) {
    return decodeURI(
        (RegExp(name + '=' + '(.+?)(&|$)').exec(location.search)||[,null])[1]
    );
}

function getURLParam2(name) {
    var m=RegExp(name + '=' + '(.+?)(&|$)').exec(location.search);
    return (null!==m && 'undefined'!==typeof m[1]) ? m[1] : null;
}

function insertPixel(link) {
    $(document).ready(function(){
        $('body').append($('<img src="'+link.replace('{order_id}', getURLParam('order_id'))+'" width="1" height="1" style="position: absolute;left:-9999px;"/>'));
    });
}

function stVisit(){
    var visId = getCookie('LPmagCode');
    var ops = {
        ref: document.referrer
    };
    if ('undefined'===typeof visId){
        ops['new']=1;
    } else {
        ops['id']=visId;
    }

    $.ajax({
        url: window.baseUrl + 'stat/visit',
        data:ops,
        cache:false,
        success:function(res){
            var data = JSON.parse(res);
            console.log(data);
            if ('undefined'===typeof data.res){return;}
            switch (data.res){
                case '0': console.log(data.mes); break;
                case '1':
                    if ('undefined'!==typeof data.id){
                        stVisitPropagate(data.id);
                    } else {
                        var visId = getCookie('_magCode');
                        if ('undefined'!==typeof visId){
                            stVisitPropagate(visId);
                        }
                    }
                    break;
            }
        }
    })
}

function stVisitPropagate(id){
    var list = [
        'lpmotor.ru',
        'lpmotor.org',
        'bm360.ru',
        'admin.lpmotor.ru'
//        'http://admin.bmtower1.bz'
    ];
    var script;
    for (var k in list){
        script = document.createElement('img');
        script.className = 'mag_img';
        script.src = (document.location.protocol == "https:" ? "https:" : "http:")+'/'+list[k]+'/stat/magcode.png?id='+id;//+'&_='+(+new Date());
        script.onload = function(){ this.parentNode.removeChild(this); };
        document.getElementsByTagName('body')[0].appendChild(script);
    }
    script=k=list=null;
}

window._lpcid_hosts=[
    'http://lpmotor.ru',
    'http://lpmotor.org',
    'http://bm360.ru',
    'https://admin.lpmotor.ru'
    //'http://admin.bmtower1.bz'
];
function stLpcidPropagate(){
    var c = getCookie('_lpcid');
    if ('undefined'!==typeof c){
        var k,img,body=document.getElementsByTagName('body')[0];
        for (k in window._lpcid_hosts){
            if (window._lpcid_hosts[k].replace(/^http(|s):\/\//,'') == document.location.host){
                continue;
            }
            img = new Image();
            img.className = 'mag_img';
            img.onload = stVisImgRemove;
            img.src = window._lpcid_hosts[k]+'/stat/cid.gif?v='+c+'&t='+(+new Date());
            body.appendChild(img);
        }
        k=img=body=null;
    }
}
function stVisImgRemove(){if(this.parentNode){this.parentNode.removeChild(this);}}
function stVisImgLoaded(){
    stLpcidPropagate();
    if (this.parentNode){this.parentNode.removeChild(this);}
}
function stVis(type){
    if ('undefined'===typeof type){type='landing';}
    var img = new Image();
    var p = getURLParam2('p');
    img.className = 'mag_img';
    img.onload = stVisImgLoaded;
    img.src = (document.location.protocol == "https:" ? "https:" : "http:")+'//'+document.location.host+'/stat/vis.gif?type='+type+'&ref='+document.referrer+(null===p ? '' : '&p='+encodeURI(p))+'&t='+(+new Date());
    document.getElementsByTagName('body')[0].appendChild(img);
    img=null;
}

