function shakeWnd(el){
    el=$(el);
    var old_position = el.css('position');
    el.css('position','relative');
    el.animate({left:-10},50,function(){
        $(this).animate({left:10}, 100, function(){
            $(this).animate({left:0}, 50, function(){
                $(this).css('position', old_position);
                old_position=null;
            });
        });
    });
}

